import "./Exercise.css";
import { Link } from "react-router-dom";
import { useEffect, useState } from "react";
import ExerciseGrid from "../ExerciseGrid/ExerciseGrid";
import axios from "axios";

export default function Exercise({ user, setUser }) {
  const [products, setProducts] = useState();
  const [isFetching, setIsFetching] = useState(false);
  const [error, setError] = useState({});
  const userId = user.id;
  const url = `http://localhost:3001/exercise/` + userId;

  useEffect(async () => {
    console.log("URL??")
    const res = await axios.get(url);
    console.log("res", res);
    if (res?.exercise) {
      setProducts(res.exercise);
      console.log("products fetched", products);
    } else {
      setError("Error fetching products.");
    }
  }, []);

  return (
    <>
      <h1 className="title"> Exercise</h1>
      <div className="boxes">
        <h1 className="overview"> Overview </h1>
        <Link to="/exerciseForm">
          <button className="overview-button">Record Exercise </button>
        </Link>
      </div>
      {/* <ExerciseGrid products = {products} /> */}
    </>
  );
}
